    [],nt"revision_timestamp": "2016-07-27T23:06:30.584801",nt"name": "washington-maritime-nwrc-initial-survey-instructions-for-tufted-puffin-monitoring",nt"isopen":
    false,nt"url": null,nt"notes": "This survey is key to assessing the status
    and trends of Tufted Puffins (Fratercula cirrhata) on their breeding colonies within
    Washington State and, with additional coordination and funding support, throughout
    WA, OR and CA. This species has recently been petitioned for listing under the U.S.Endangered
    Species Act (ESA) and listed as endangered in Washington state. During the past
    15 years, population declines of 3-21 percent per year have been estimated for Tufted
    Puffins in California,Oregon, and Washington (USFWS 2005). Speich and Wahl (1989)
    estimated the population in Washington at 23,300 birds with as much as 50% more
    due to uncertainties associated with survey methodologies. However, surveys from
    2007-2008 suggested the minimum population estimate in WA is less than 3,000 individuals
    with significant rates of decline recorded on pelagic surveys (Hanson & Wiles 2015).
    Because the species is highly dispersed and solitary at sea during the nonbreeding
    season, the best time to monitor them is during the breeding season, yet puffins
    nest in burrows that are difficult to access because breeding colonies are often
    located on unstable bluffs or inaccessible islands. As a result, accurate population
    estimates are lacking (USFWS 2005) which further hinders a clear assessment of the
    species status both within the state and the southern portion of their range.",nt"license_title":
